import React from "react";
import "../css/FixModal.css"
const FixModal = ({selectedHeader, open}) => {

  if(open){
    return (
      <div id="fix-modal" className="fix-modal">
        <div className="fix-modal-content">
          <p className="">3/18 errors</p>
        </div>
      </div>
    )
  }else {
    return null;
  }


}

export default FixModal;
